// next는 import React from 'react'가 필요없음 있어도 상관없음
import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from "../components/AppLayout";

const Home = () => {
    const {isLoggedIn} = useSelector((state) => state.user);
    
    return (
        <AppLayout>
            <PostForm/>
            <PostCard/>
        </AppLayout>
    );
}

export default Home;
